const atob = require('atob');
const Blob = require('node-blob');
const maquillaje_image = '';
const cortes_lavados_image = '';
const b64toBlob = (b64Data, contentType = '', sliceSize = 512) => {
    const byteCharacters = atob(b64Data);
    const byteArrays = [];
    for (let offset = 0; offset < byteCharacters.length; offset += sliceSize) {
        const slice = byteCharacters.slice(offset, offset + sliceSize);
        const byteNumbers = new Array(slice.length);
        for (let i = 0; i < slice.length; i++) {
            byteNumbers[i] = slice.charCodeAt(i);
        }
        const byteArray = new Uint8Array(byteNumbers);
        byteArrays.push(byteArray);
    }
    return new Blob(byteArrays, {type: contentType});
};
const maquillajeBlob = b64toBlob(maquillaje_image, 'image/jpg');
const cortesBlob = b64toBlob(cortes_lavados_image, 'image/png');
exports.seed = function (knex, Promise) {
    // Deletes ALL existing entries
    return knex('corporations.services').del()
        .then(function () {
            // Inserts seed entries
            return knex('corporations.services').insert([
                {
                    name: 'Maquillaje',
                    description: 'Dale vida a tu cabello junto a los expertos en color, en V&G nos dedicamos a darte resultados que harn que resaltes como nunca.',
                    image: maquillajeBlob.buffer,
                    imageType: 'image/jpg'
                },
                {
                    name: 'Cortes y Lavados',
                    description: 'Deja tu cabello en las manos de los mejores, desde un espectacular corte hasta una tan merecida hidratacin, en V&G haremos a tu cabello y a ti sentirse como nunca.',
                    image: cortesBlob.buffer,
                    imageType: 'image/jpg'
                },
            ]);
        });
};
